import React from 'react';
import MyButton from "../../UI/button/MyButton";
import AddText from "./AddText";

const Text = () => {
    return (
        <div className="text">
            <button className="text_btn">Start Type</button>
            <div className="wrapper">
                <div className="text_item">
                <AddText/>
                </div>
            </div>

        </div>
    );
};

export default Text;
